import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Open a product modal to ensure there's a modal to close
    // Try to find a product card and click it
    // Use a robust selector: find a .product-card or .category-card or fallback to a .cta-button
    let modalOpened = false;
    if (await page.$('.product-card')) {
      await page.waitForSelector('.product-card', { timeout: 5000 });
      await page.click('.product-card');
      modalOpened = true;
    } else if (await page.$('.category-card')) {
      await page.waitForSelector('.category-card', { timeout: 5000 });
      await page.click('.category-card');
      // Wait for products to load and click a product card if it appears
      if (await page.$('.product-card')) {
        await page.waitForSelector('.product-card', { timeout: 5000 });
        await page.click('.product-card');
        modalOpened = true;
      }
    } else if (await page.$('.cta-button')) {
      await page.waitForSelector('.cta-button', { timeout: 5000 });
      await page.click('.cta-button');
      // Wait for modal if it appears
      if (await page.$('.modal')) {
        modalOpened = true;
      }
    }

    // Wait for modal to appear
    await page.waitForSelector('.modal', { timeout: 5000 });

    // Take screenshot with modal open
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_modal_open.png'));

    // Press Escape key to close the modal
    await page.keyboard.press('Escape');

    // Wait for modal to close (display: none)
    await page.waitForSelector('.modal', { state: 'hidden', timeout: 5000 });

    // Take screenshot after modal closed
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_modal_closed.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_modal_closed.png'));

    // Extract data: check if modal is hidden
    const modalDisplay = await page.evaluate(() => {
      const modal = document.querySelector('.modal');
      if (!modal) return null;
      return window.getComputedStyle(modal).display;
    });

    return {
      success: true,
      action: "Opened a modal and closed it using the Escape key",
      extractedData: {
        modalDisplayAfterEscape: modalDisplay
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
